export default function Brands() {
    return (
        <div className="wrapper__brands">
            <section className="container__brands">
                <div className="brands_info"></div>
                    <h2>Let us find your faves from 1000+ brands & styles</h2>
                    <p>We cary women's sizes XS-3X including Plus, Petite and Maternity; men's sizes XS-3XL including Big & Tall and kids sizes 2T-18.</p>
                <div className="brands_list"></div>
            </section>

        </div>
    )
}
